import { useState } from 'react';
import './App.css';
import Cart from './Component/Cart';
import Header from './Component/Header';
import Services from './Component/ProductList';

function App() {
  const [product, setProduct]= useState([
    {
      name:"Oppo",
      provider:"Amazon",
      price:"8000",
      url:"data:image/jpeg;base64,"
    },
    {
      name:"Vivo",
      provider:"Amazon",
      price:"22000",
      url:"data:image/jpeg;base64,"
    },
    {
      name:"Realme",
      provider:"Amazon",
      price:"12000",
      url:"data:image/jpeg;base64,"
    },
    {
      name:"Nokia",
      provider:"Amazon",
      price:"1200000",
      url:"data:image/jpeg;base64,"
    },
  ])

  const [cart, setCart]=useState([])

  const [showcart, setShowcart]=useState(false)

  const Addtocart=(data)=>{
    console.log(data)
    setCart([...cart,{...data}])
  }

  const handelshow=(value)=>{
    setShowcart(value)
  }

  return (
    
    <div>
      <Header count={cart.length} handelshow={handelshow} />
      {
        showcart ?
        <Cart cart={cart} />:
      <Services Addtocart={Addtocart} product={product}/>}
    </div>
  );
}

export default App;
